<!DOCTYPE html>
<html>
<head>
  <link rel="icon" href="/images/Internet.jpg" type="image/jpeg">
  <link rel="shortcut icon" href="/images/Internet.jpg" type="image/jpeg">
  <link rel="apple-touch-icon" sizes="180x180" href="images/Internet.jpg">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta charset="UTF-8">
  <title>ましゅ信！お問い合わせフォーム</title>
  
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: Arial, sans-serif;
      background-color: #f1f1f1;
    }

    .container {
      max-width: 500px;
      margin: 0 auto;
      padding: 20px;
      background-color: #ffffff;
      border: 1px solid #e0e0e0;
    }

    h1 {
      text-align: center;
      margin-bottom: 20px;
    }

    label {
      display: block;
      margin-bottom: 8px;
      font-weight: bold;
    }

    input[type="text"],
    input[type="email"],
    textarea {
      width: 100%;
      padding: 8px;
      border: 1px solid #e0e0e0;
      border-radius: 4px;
    }

    textarea {
      resize: vertical;
      height: 120px;
    }

    input[type="submit"] {
      display: block;
      width: 100%;
      padding: 10px;
      background-color: #4285F4;
      color: #ffffff;
      border: none;
      border-radius: 4px;
      cursor: pointer;
      font-weight: bold;
    }

    input[type="submit"]:hover {
      background-color: #3367D6;
    }

    .success-message {
      text-align: center;
      font-size: 24px;
      font-weight: bold;
      margin-bottom: 10px;
      display: none;
    }

    .info-message {
      text-align: center;
      font-size: 14px;
      margin-bottom: 20px;
    }

    .back-button {
      display: block;
      width: 100%;
      padding: 10px;
      background-color: #4285F4;
      color: #ffffff;
      border: none;
      border-radius: 4px;
      cursor: pointer;
      text-align: center;
      font-weight: bold;
      text-decoration: none;
      margin-top: 20px;
    }

    .back-button:hover {
      background-color: #3367D6;
    }

    .hidden {
      display: none;
    }

    @media (max-width: 500px) {
  .container {
    max-width: 100%;
    padding: 10px;
  }
}


  </style>
</head>
<body>
  <div class="container">
    <h1>ましゅ信！お問い合わせフォーム</h1>
    <div id="contactFormContainer">
      <form id="contactForm" action="#" method="POST">
        <label for="name">名前</label>
        <input type="text" id="name" name="name" required placeholder="名前">

        <label for="email">メールアドレス</label>
        <input type="email" id="email" name="email" required placeholder="example@example.com">

        <label for="message">お問い合わせ内容</label>
        <textarea id="message" name="message" required placeholder="お問い合わせ内容を入力してください"></textarea>

        <input type="submit" value="送信" id="submitButton">
      </form>
    </div>
    <div id="successContainer" class="hidden">
      <p class="success-message">お問い合わせが完了しました。</p>
      <p class="info-message">お問い合わせが完了しました<BR>返信は入力いただいたメールアドレスに送信いたします。<br>返信までお時間をいただくことがあります。ご了承ください。<br>どうぞよろしくお願いいたします。</p>
      <a href="index.html" class="back-button">ホームに戻る</a>
    </div>
  </div>
